#most common

from collections import Counter

x=""

count = Counter(x)

print(count)

def owncounter(list):
    new_x={}
    for elem in list:
        if elem in new_x:
            new_x[elem]+=1
        else:
            new_x[elem]=1
    return sorted(new_x.items()),sorted(new_x.items(),key=lambda x:x[1],reverse=True)

print(owncounter(x))
